SELECT * FROM (SELECT * FROM (SELECT c_custkey, c_name, sum(l_extendedprice * (1 - l_discount)) as revenue, c_acctbal, n_name, c_address, c_phone, c_comment FROM (select * from customer where (("c_custkey" >= 1) AND ("c_custkey" < 45139)) OR (("c_custkey" >= 92080) AND ("c_custkey" < 139617)) OR (("c_custkey" >= 184356) AND ("c_custkey" < 235427)) OR (("c_custkey" >= 329218) AND ("c_custkey" < 377297)) OR (("c_custkey" >= 423351) AND ("c_custkey" < 471001)) OR (("c_custkey" >= 517679) AND ("c_custkey" < 565547)) OR (("c_custkey" >= 751777) AND ("c_custkey" < 842308)) OR (("c_custkey" >= 889590) AND ("c_custkey" < 937275)) OR (("c_custkey" >= 1076617) AND ("c_custkey" < 1171160)) OR (("c_custkey" >= 1220816) AND ("c_custkey" < 1264890)) OR (("c_custkey" >= 1310610) AND ("c_custkey" < 1451555))) cc, (select * from orders where (("o_orderkey" >= 1) AND ("o_orderkey" < 3614019)) OR (("o_orderkey" >= 5584739) AND ("o_orderkey" < 40951842)) OR (("o_orderkey" >= 42883267) AND ("o_orderkey" < 60000001))) oo, (select * from lineitem where (("l_orderkey" >= 1) AND ("l_orderkey" < 3780867)) OR (("l_orderkey" >= 5680996) AND ("l_orderkey" < 40925344)) OR (("l_orderkey" >= 42899968) AND ("l_orderkey" < 60000001)) ) ll, nation WHERE c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate >= '1994-12-01' and o_orderdate < '1995-03-01'and l_returnflag = 'R' and c_nationkey = n_nationkey GROUP BY c_custkey, c_name, c_acctbal, c_phone, n_name, c_address, c_comment) o1 ORDER BY revenue desc) o2 limit 20;
